// src/App.js
import React from 'react';
import TimesheetForm from './TimesheetForm';
import TimesheetList from './TimesheetList';

function App() {
  return (
    <div className="App">
      <h1>Employee Timesheet</h1>
      <TimesheetForm />
      <TimesheetList />
    </div>
  );
}

export default App;
